"use strict";(self.webpackChunkwebsite=self.webpackChunkwebsite||[]).push([[3814],{47250:e=>{e.exports=JSON.parse('{"tag":{"label":"integration","permalink":"/teamforge/docs/tags/integration","allTagsPath":"/teamforge/docs/tags","count":11,"items":[{"id":"IntegrationPages/iaf-binaries-add","title":"Add Binaries to TeamForge Projects","description":"When TeamForge Site Administrator has made the Binaries application available, Project Administrators can add it as one of their project tools.","permalink":"/teamforge/docs/IntegrationPages/iaf-binaries-add"},{"id":"authenticateintegratedapp","title":"Authenticate your Integrated Application with TeamForge","description":"To help third party developers write integrated applications, CollabNet provides an SDK.","permalink":"/teamforge/docs/authenticateintegratedapp"},{"id":"codereviewpolicy","title":"Control Your Code Review Policy","description":"You can control all Gerrit Code Review features directly from TeamForge by specifying a code review policy.","permalink":"/teamforge/docs/codereviewpolicy"},{"id":"scripts/create_webhook_event_py","title":"create_webhook_event.py","description":"This script creates an event, a publisher (with the Webhook URL), and a subscriber in TeamForge Webhooks-based Event Broker for a specified application.","permalink":"/teamforge/docs/scripts/create_webhook_event_py"},{"id":"IntegrationPages/installnexusplugin","title":"Install or Upgrade the TeamForge\u2014Nexus Integration Plugin","description":"Once you have your Nexus server set up, install the TeamForge-Nexus integration plugin.","permalink":"/teamforge/docs/IntegrationPages/installnexusplugin"},{"id":"installpages/requirements","title":"Installation Requirements","description":"Here\'s what it takes to install and run TeamForge and other integrations supported by TeamForge.","permalink":"/teamforge/docs/installpages/requirements"},{"id":"setupgitreplica","title":"Set up Git Replica Servers","description":"On sites distributed across multiple geographic locations, Git Replica Servers are local and remote mirror servers that can provide up-to-date copies of the central repositories. If set up, Git Replica Servers can address load balancing and fetch performance issues. You can set up one or more Git Replica Servers (also referred to as slave or mirror servers) with TeamForge 8.1 and later.","permalink":"/teamforge/docs/setupgitreplica"},{"id":"setuplfs","title":"Set up LFS","description":"Git Large File Storage (LFS) is a Git extension for versioning large files. Git LFS replaces large files such as audio samples, videos, datasets, and graphics with text pointers inside Git, while storing the file contents on a separate server (typically a remote server).","permalink":"/teamforge/docs/setuplfs"},{"id":"IntegrationPages/managebinaries","title":"TeamForge Binary Integration Overview","description":"An important aspect of the end-to-end development lifecycle is the creation and storage of software packages that are often binary artifacts. In the Java world, these are usually reusable jars that are used by other projects. Binary artifact repository managers are software systems that manage, version, and store binary artifacts. Example of such repository manager is Sonatype Nexus.","permalink":"/teamforge/docs/IntegrationPages/managebinaries"},{"id":"gitoverview","title":"TeamForge-Git Integration","description":"TeamForge supports integration with Git, a distributed version control tool powered by Gerrit.","permalink":"/teamforge/docs/gitoverview"},{"id":"gitreference","title":"TeamForge-Git Integration Reference","description":"This topic discusses the mappings between TeamForge and Gerrit, Gerrit access rights, directory structure, connectivity, logs and configuration properties, and differences compared to vanilla Gerrit.","permalink":"/teamforge/docs/gitreference"}],"unlisted":false}}')}}]);